      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 54 IN ( - col0, + col2 * col2 * 90, - col0 + - 52, - - 43 );
  - name: tab2

outputs:
  - name: q4932.out
    data: |
      46	51	23
      64	77	40
      75	67	58
